function Sitemap(urls) {
    return (
        <div className="sitemap-urls">
            <table width="100%">
                <thead>
                    <tr>
                        <td>URLs</td>
                        <td>Change Frequency</td>
                    </tr>
                </thead>
                <tbody>
                    <TableRows urls="{urls}" />
                </tbody>
            </table>
        </div>
    );
}

function TableRows(data) {
    console.log(data);
}



export default Sitemap;
